            "pairingText": "Chenin Blanc, Gewurztraminer, and Riesling are great choices for Asian. The best wine for Asian food depends on the cuisine and dish - of course - but these acidic whites pair with a number of traditional meals, spicy or not. One wine you could try is L'Ecole 41 Chenin Blanc. It has 4.4 out of 5 stars and a bottle costs about 18 dollars.",
