        "instructions": "<ol><li>Cook noodles according to package directions; drain well.</li><li>Blanch snow peas in boiling water 1 minute. Drain and refresh in cold water, then pat dry. Transfer to medium bowl. Add carrots and scallions.</li><li>In medium skillet, heat oil over medium heat. Add garlic and chile pepper and cook, stirring often, 30 seconds. Add mushrooms and cook, stirring often, 2 minutes. Add mushrooms to bowl with vegetables.</li><li>Add vinegar, ginger and hoisin sauce to pan and warm through. Pour over vegetables. Add noodles and toss. Serve warm or at room temperature.</li><li>This recipe yields 4 servings.</li><li>Comments: Once the vegetables have been sliced, this tasty main dish salad can be thrown together in minutes.</li><li>Serve these noodles with a packaged miso soup mix.</li></ol>",
