            "pairingText": "Chianti, Trebbiano, and Verdicchio are great choices for Ravioli. Italians know food and they know wine. Trebbiano and Verdicchio are Italian white wines that pair well with fish and white meat, while Chianti is a great Italian red for heavier, bolder dishes. The Ricasoli Brolio Chianti Classico Riserva with a 4 out of 5 star rating seems like a good match. It costs about 27 dollars per bottle.",
