        "instructions": "<ol><li>To make sauce, combine all sauce ingredients (Greek yogurt, lemon zest, 1 tablespoon mint, 1 tablespoon olive oil, 1/2 teaspoon salt, and 1/2 teaspoon minced garlic) in a small bowl and set aside until ready to serve meatballs. Chill, if desired.</li><li>To make the meatballs, start by preheating the oven to 400 degrees Fahrenheit.</li><li>Next, combine ginger, 1 tablespoon garlic, curry, garam masala, salt, and pepper.</li><li>Add meats and gently combine with hands until spices are just evenly distributed. Do not overmix.</li><li>Gently roll meat into 1 1/2 inch balls and set on a rimmed baking sheet or jelly roll pan.</li><li>Roast meatballs for 20-25 minutes until browned on the outsides and cooked through.</li><li>Transfer meatballs to serving dish and serve with yogurt sauce and toasted pitas.</li></ol>",
