        "winePairing": {},
        "instructions": "<ol><li>Take the steaks out of the fridge 45 minutes before frying them.</li><li>Dry the meat with paper towels.</li><li>Rub kosher salt and pepper with the olive oil into the steaks, let them sit and get to room temperature.</li><li>Cut the asparagus and fry in a pan for about 10 minutes under medium heat. Salt and pepper the asparagus.</li><li>Heat up a cast iron pan under high heat and put in the coconut oil (it has a higher smoking point than olive oil). Make sure the pan is smoking hot.</li><li>Fry the onions (cut into rings) and take them out again.</li><li>Put in the steaks and fry them for about 2-3 minutes on each side, flipping them every 60 seconds for even heat distribution.</li><li>When the steaks are almost done, reduce heat to medium, throw in roughly chopped garlic and the butter.</li><li>Stir butter and garlic in the pan and scoop the buttery garlic goodness over the steaks a couple of times.</li><li>When done, take the steaks out and let them sit for 3 minutes next to the served asparagus (juices need to settle). </li><li>If you can't take it anymore to look at your perfect steak, eat up!</li></ol>",
